import React from 'react';
import SongCard from './SongCard';
import { withRouter } from 'react-router-dom';
//withRouter gives the app the props
class SongList extends React.Component{
  state = {
    songs: []
  }

  componentDidMount = () => {
    const url = this.props.currentPlaylist.links.tracks.href + '?apikey=MTU1YjllNjUtOTIwNi00MGJlLWJlOWMtZGYxMjJhZDI0NTk5';
    url
      ? fetch(url)
      .then(resp => resp.json())
      .then(track => {
        this.setState({
          songs: track
        })
      })
      : <h1>Didn't Work</h1>
  }

  componentDidMount = () => {
    let token = localStorage.token;
    token
     ? fetch("http://localhost:3000/api/v1/current_user",{
        method: "GET",
        headers: {
          "content-type": "application/json",
          accepts: "application/json",
          Authorization: `Bearer ${token}`
        }
      })
      .then( resp => resp.json())
      .then(user => {
        this.setState({user: user }, () => {
          this.props.history.push("/playlists")
        });
      })
    : (this.props.history.push("/signup"))
  };

  // console.log(this.props.playlist.href + '?apikey=MTU1YjllNjUtOTIwNi00MGJlLWJlOWMtZGYxMjJhZDI0NTk5');
  render(){
    console.log("SongList", this.state);
    return(
      <div>
      <h1>Song List</h1>
      </div>
    )
  }
}

export default withRouter(SongList);
